import React from 'react'
import { Segment, Sidebar, Divider,Menu, Header } from 'semantic-ui-react'

class SidePanel extends React.Component{
    render(){

        return(
          <Menu

            inverted
            fixed='left'
            vertical
            style={{width: '250px',background: '#e7e7e7', top: '80px'}}
          >
              <Header block color='brown' textAlign='center'>
                Channel
              </Header>
              <Menu.Item as='Header' content='test' color='black' inverted>

              </Menu.Item>
          </Menu>
        )

    }
}

export default SidePanel;
